import React from "react";
import "./App.css";
import ItemCard from "./ItemCard";
class App extends React.Component {
  componentDidMount() {
    fetch(`https://api.myjson.com/bins/qhnfp`).then(response =>
      response.json()
    );
  }
  render() {
    return (
      <div className="App">
        <ItemCard />
      </div>
    );
  }
}

export default App;
